from typing import Dict, Any, List


def vba_scripting_dictionary_to_python_dict(data: Any) -> Dict:
    # TODO: Maybe turn this into a custom xlwings converter?
    #  See https://docs.xlwings.org/en/stable/converters.html#custom-converter
    return {} if data is None else dict(zip(data.Keys(), data.Items()))


def vba_collection_to_python_list(data: Any) -> List:
    # The collection object is iterable, even on the python side, so this should work:
    return list(data)
